import React from "react";
import {NavLink} from 'react-router-dom';

function Nav(){
    return (
        <div className="nav-bar">

            <NavLink
            to="/"
            exact
            className="nav-links"
            >
                Home
            </NavLink>
            <NavLink className="nav-links" to="/recipes">View All of Our Recipes</NavLink>
            <NavLink className="nav-links" to="/recipeform">Add Your Own Recipe</NavLink>
            <div className="nav-bar-image">
                <img className="nav-bar-image" src="https://acing.net/wp-content/uploads/2020/09/Ingredient-Resources.jpg"/>
            </div>
        </div>
    )
}

export default Nav;
